import {Button, Col} from 'react-bootstrap'


let usersURL = "http://localhost:3000/events/"

export default class AddCollab extends Component {
    state = {
        name: '',
        email: ''
    }

    handleChange=(e)=> {
        const {name, value} = e.target
        this.setState({
            [name]: value
        })
